%[text] ## **Problem 3 (10 points) The K\-Means Algorithm for Clustering**
%[text] In this problem, we will be implementing the K\-Means Algorithm for clustering vectors in $\\mathbb{R}^2$. To start, let us load and visualize our dataset.
load clustering_data.mat
figure; %[output:0cb1f089]
plot(x(:,1),x(:,2),'.b','MarkerSize',15); %[output:0cb1f089]
title("Raw Data") %[output:0cb1f089]
axis equal; %[output:0cb1f089]
rng(2016); % for reproducibility
%[text] ## **Part (a) The Algorithm**
%[text] In this part, we will implement the algorithm for $K=3$, which seems to be a reasonable number of clusters for this dataset. Show the clusters after the 1st, 5th, 10th and last iteration. This will illustrate the cluster evolution as the algorithm runs. $\\texttt{subplot()}$ is very useful here.
%[text] To further aid our understanding of the algorithm, we will be keeping track of a few things:
%[text] 1. Keep track of the evolution of the representatives for each cluster. You can do so by updating the variable $\\texttt{z}$ after each iteration.
%[text] 2. Keep track of the objective function value at each iteration. \
%[text] Once you are done implementing the algorithm, feel free to change the value of $\\texttt{K}$ and see how the clusterings are altered.
%{
Some useful setup done for you
%}
K = 3; % number of clusters
n = length(x); % number of vectors
c = zeros(n, 1); % clustering : c(i) is the cluster number for vector x(i, :)
iter = 0; % iteration number
z = datasample(x, K); % initial representatives

%{
Step 1: Partitioning into clusters given our initial representatives
%}
for i = 1:n
    c_min = -1;
    dist_min = Inf;
    for k = 1:K
        d = norm(x(i, :) - z(k, :)); 
        %{calculating distance from initial centroids
        if d < dist_min
            c_min = k;
            dist_min = d;
        end
    end
    %{classifying the point based on the closest centroid
    c(i) = c_min;
end
%{
Increment the iteration number
Update the objective function
%}
plots_done = 1;
objective_new = [];
z_prev = 0;

journey1 = zeros(0,2);
journey2 = zeros(0,2);
journey3 = zeros(0,2); %{initializing jounreys for cluster centroids 


while z_prev ~= z %{while there is still a change in the hypothesis %[output:group:629a02e1]
    z_prev = z(:, :);
    % Incrementing the iteration number, updating cluster centroids
    iter = iter + 1;
    for k = 1:K
        x_k = x(c == k, :); %{all the x that were classified under cluster k
        if ~isempty(x_k)
            z(k, :) = mean(x_k); %{new k is the mean of all these x
        end
    end
    journey1 = [journey1; z(1, :)];
    journey2 = [journey2; z(2, :)];
    journey3 = [journey3; z(3, :)]; %{keep track of centroid journeys after each update
    for i = 1:n
        c_min = 10;
        dist_min = Inf;
        for k = 1:K
            d = norm(x(i, :) - z(k, :));
            if d < dist_min
                c_min = k;
                dist_min = d;
            end
        end
        c(i) = c_min; %{reclassifying points based on new centroid positions
    end

    p_tot = 0;
    for k = 1:K
        x_k = x(c == k, :);
        for i = 1:length(x_k)
            p_tot = p_tot + (norm(x_k(i, :) - z(k, :))^2);
        end
    end
    p_tot = p_tot/n;

    objective_new = [objective_new, p_tot]; %{appending the new objective

    colors = ['r', 'g', 'b'];

    if ismember(iter,[1,5,10,16]) %{if we have reached an 
        subplot(2, 2, plots_done); %[output:3a9f776f]
        hold on;
        for k = 1:K
            x_k = x(c == k, :);
            color = colors(k);
            scatter(x_k(:, 1), x_k(:, 2), 30, color);
        end
        title(['Clusters on iteration: ' num2str(iter)]);
        hold off;
        plots_done = plots_done + 1;
    end
end %[output:group:629a02e1]
%[text] ## **Part (b) Evolution of Representatives**
%[text] Now, let us see the dynamics of the representatives. Plot the original (raw) data and the trajectories of the cluster representatives in one figure. $\\texttt{squeeze()}$ might be useful here.
figure %[output:301216d9]
plot(x(:, 1), x(:, 2), '.m', journey1(:, 1), journey1(:, 2), '-.r', journey2(:, 1), journey2(:, 2), '--g', journey3(:, 1), journey3(:, 2), '-b') %[output:301216d9]
legend('Raw data', 'Centroid Red Cluster Journey', 'Centroid Blue Cluster Journey', 'Centroid Green Cluster Journey'); %[output:301216d9]
title('Journey of each cluster centroid starting from iteration 0') %[output:301216d9]
%[text] ## **Part (c) Objective Function**
%[text] Plot the values of the objective function against the iteration number. Does the trend match what we expect? Report the minimum value of the objective function using $\\texttt{disp()}$.
figure; %[output:65b97af4]
plot(1:iter, objective_new); %[output:65b97af4]
title("Objective Function p_tot vs Iteration Number"); %[output:65b97af4]
xlabel("Iteration"); %[output:65b97af4]
ylabel("Objective Function"); %[output:65b97af4]
final_list = objective_new(end, :);
disp(strcat('Smallest value of objective function is = ', num2str(final_list(16)))); %[output:165d296e]
disp(iter); %[output:21a40780]
%[text] ## **Part (d) Comparing with** $\\texttt{kmeans()}$
%[text] The K\-means algorithm is a very popular clustering algorithm and it is often used in various applications. As such, it is implemented in most numerical software packages. In MATLAB, it exists as the built\-in function $\\texttt{kmeans()}$. In the simplest form, $\\texttt{idx = kmeans(X, k)}$ performs K\-means clustering to partition the rows in the data matrix $\\texttt{X}$ into $\\texttt{k}$ clusters, and returns a vector $\\texttt{idx}$ containing cluster indices for each row. To compare your implementation with the built\-in one, plot the clustering your obtained in (a) and the clustering obtained by using $\\texttt{kmeans()}$.

plots_done = 1 %[output:21be7172]
subplot(2, 2, plots_done); %[output:7262d759]
hold on; %[output:7262d759]
for k = 1:K
    x_k = x(c == k, :);
    color = colors(k);
    scatter(x_k(:, 1), x_k(:, 2), 30, color); %[output:7262d759]
end
title('Final clustering using our implementation'); %[output:7262d759]
hold off; %[output:7262d759]
builtinplot = subplot(2, 2, 3); %[output:7262d759]
idx = kmeans(x, K);
cluster1points = zeros(0, 2);
cluster2points = zeros(0, 2);
cluster3points = zeros(0, 2);
for i = 1:n
    vector = x(i, :);
    if idx(i) == 1
        cluster1points = [cluster1points; vector];
    end
    if idx(i) == 2
        cluster2points = [cluster2points; vector];
    end
    if idx(i) == 3
        cluster3points = [cluster3points; vector];
    end
end
plot(builtinplot, cluster1points(:, 1), cluster1points(:, 2), '.r', cluster2points(:, 1), cluster2points(:, 2), '.b', cluster3points(:, 1), cluster3points(:, 2), '.g'); %[output:7262d759]
title('Final clustering using MATLAB built-in kmeans() '); %[output:7262d759]
%[text] ## **Problem 5 (10 points) Gram Matrices for Text Classification**
%[text] Gram matrices are used in many different applications. Here is a simple example of application to classification of text documents. Suppose we have a collection of $n$ text documents and we want to measure similarity between them. First, we predefine a list of words (the "dictionary'') $w\_1,w\_2,w\_3,\\cdots , w\_m$ appearing in the documents. Then, for each text $i$ we construct a vector $x\_i\\in\\mathbb{R}^m$ whose $j^{\\text{th}}$ component is the number of times the word $w\_j$ appears in the text. This way, each text is represented as a vector in $\\mathbb{R}^m$. This representation is often referred to as the "bag of words" representation. 
%[text] Let $\\langle\\cdot,\\cdot\\rangle$ be the usual dot product in $\\mathbb{R}^m$ and $\\|\\cdot\\|$ be the Euclidean norm. Let us normalize all vectors $z\_i = \\frac{x\_i}{\\|x\_i\\|}$ and define:
%[text]{"align":"center"} $Z = [z\_1\\cdots z\_n]\\in\\mathbb{M}\_{m\\times n}$
%[text] Let $G$ be the Gram matrix associated with $z\_1\\cdots z\_n$:
%[text]{"align":"center"} $G = Z^TZ\\in \\mathbb{M}\_{n\\times n}$
%[text] Since all $z\_i$ are unit vectors:
%[text]{"align":"center"} $G\_{ij}=z\_i^Tz\_j=\\|z\_i\\|\\|z\_j\\|\\cos\\theta\_{ij}=\\cos\\theta\_{ij}$
%[text] where $\\theta\_{ij}$is the angle between $z\_i$ and $z\_j$, which of course is the same as the angle between $x\_i$ and $x\_j$. This is widely use as a *measure of similarity* between documents. Hence, the more similar two texts $i$ and $j$ are, the closer $G\_{ij}$ is to 1\.
%[text] Now, let us apply this method to real texts. The task is to compare the text of the US Constitution ([found here](https://www.constituteproject.org/constitution/United_States_of_America_1992)) with the Wikipedia pages of Bernie Sanders, Hillary Clinton, Donald Trump, Ted Cruz, and John Kasich, and to find the page which is "closest" to the Constitution.
%[text] ## Part (a) Setup
%[text] To start, we will define a list of $m=10$ words. To find the most "relevant words", copy the text of the Constitution and paste it into a word\-cloud generator ([such as this one](http://worditout.com/word-cloud/make-a-new-one)). High frequency words appear large and we can form the dictionary from these words. Note that common sense is needed: words like "amendment'' and "section'' would appear large, but it makes no sense to include them into the dictionary. Also, it makes sense to include "United States'' as a single "word'', not two separate words, etc. But you are free to chose your own dictionary. In the code box below, please fill out the dictionary with your chosen words.
%{
DICTIONARY:
1) president
2) representatives
3) congress
4) members
5) office
6) executive
7) legislative
8) senators
9) majority
10) United States
%}
%[text] ## Part (b) Fun
%[text] With your specified dictionary, let us see which Wikipedia page is closest. First, construct $n=6$ vectors (as specified above), one for each Wikipedia page and one for the Constitution. No need to get fancy here; just go to the related page and search for the number of occureneces of the words in your dictionary. Put all your results in a column vector for each candidate:
%{Creating the dictionaries using ctrl + find to get the occurences
constitution = [ 121 31 62 10 57 16 2 13 14 89 ];
sanders = [ 91 17 61 20 29 0 2 7 3 58 ];
clinton = [ 119 4 25 14 27 0 0 7 3 48 ];
trump = [ 181 7 40 12 50 32 0 0 11 75 ];
cruz = [ 101 1 35 5 21 3 0 18 9 76 ];
kasich = [ 69 20 27 12 23 10 2 7 3 17 ];

%{ Normalising these vectors
constitution = constitution/norm(constitution);
sanders = sanders/norm(sanders);
clinton = clinton/norm(clinton);
trump = trump/norm(trump);
cruz = cruz/norm(cruz);
kasich = kasich/norm(kasich);


%{
Construct the Gram matrix G as discussed
%}
Z = zeros(0, 10);
Z = [Z; constitution];
Z = [Z; sanders];
Z = [Z; clinton];
Z = [Z; trump];
Z = [Z; cruz];
Z = [Z; kasich];
Z = Z';

G = Z' * Z;

maxind = 0;
max = 0;
for i = 2:6
    cos = G(i, 1);
    if cos > max
        max = cos;
        maxind = i;
    end
end


%{
You can visualize G by uncommenting the following lines of code
%}
figure; %[output:8cd49b1e]
imagesc(G); %[output:8cd49b1e]


%{
Find the page closest to the Constitution text and report your
answer using disp()
%}
if maxind == 2 %[output:group:5f09767f]
    disp('Bernie Sanders'); %[output:1d6445b3]
end %[output:group:5f09767f]
if maxind == 3
    disp('Hillary Clinton');
end
if maxind == 4
    disp('Donald Trump');
end
if maxind == 5
    disp('Ted Cruz');
end
if maxind == 6
    disp('John Kasich');
end
